Your application may panic for a number of reasons (e.g. when you call .unwrap() on a None). And when this happens, you want to be a good citizen and: provide a useful stacktrace so that they can report errors back to you. not leave the users terminal state in a botched condition, resetting it back to the way it was. Hereâ€™s an example of initialize_panic_handler() using better_panic to provide a prettier backtrace by default. use better_panic::Settings; pub fn initialize_panic_handler() { std::panic::set_hook(Box::new(|panic_info| { crossterm::execute!(std::io::stderr(), crossterm::terminal::LeaveAlternateScreen).unwrap(); crossterm::terminal::disable_raw_mode().unwrap(); Settings::auto().most_recent_first(false).lineno_suffix(true).create_panic_handler()(panic_info); }));
} I personally like to reuse the Tui struct in the panic handler. That way, if I ever decide to move from crossterm to termion in the future, thereâ€™s one less place in the project that I have to worry about refactoring. Letâ€™s assume you have a tui.rs file like so: use std::{io, panic}; use anyhow::Result;
use crossterm::{ event::{DisableMouseCapture, EnableMouseCapture}, terminal::{self, EnterAlternateScreen, LeaveAlternateScreen},
}; pub type CrosstermTerminal = tui::Terminal<tui::backend::CrosstermBackend<std::io::Stderr>>; pub struct Tui { terminal: CrosstermTerminal,
} impl Tui { pub fn new(terminal: CrosstermTerminal) -> Self { Self { terminal } } pub fn init(&mut self) -> Result<()> { terminal::enable_raw_mode()?; crossterm::execute!(io::stderr(), EnterAlternateScreen, EnableMouseCapture)?; self.terminal.hide_cursor()?; self.terminal.clear()?; Ok(()) } fn reset() -> Result<()> { terminal::disable_raw_mode()?; crossterm::execute!(io::stderr(), LeaveAlternateScreen, DisableMouseCapture)?; Ok(()) } pub fn exit(&mut self) -> Result<()> { Self::reset()?; self.terminal.show_cursor()?; Ok(()) }
} Hereâ€™s an example of initialize_panic_handler() using better_panic and libc to provide a prettier backtrace by default. use better_panic::Settings; use crate::tui::Tui; pub fn initialize_panic_handler() { std::panic::set_hook(Box::new(|panic_info| { match Tui::new() { Ok(t) => { if let Err(r) = t.exit() { error!("Unable to exit Terminal: {r:?}"); } }, Err(r) => error!("Unable to exit Terminal: {r:?}"), } Settings::auto().most_recent_first(false).lineno_suffix(true).create_panic_handler()(panic_info); std::process::exit(libc::EXIT_FAILURE); }));
} In the screenshot below, I added a None.unwrap() into a function that is called on a keypress, so that you can see what a prettier stacktrace looks like:

