The directories-rs library offers a Rust-friendly interface to locate common directories (like config and data directories) based on established conventions, including the XDG Base Directory Specification. Add directories-rs to your Cargo.toml cargo add directories Use the ProjectDirs struct to retrieve paths based on your projectâ€™s domain and project name and create helper functions for getting the data_dir and config_dir. Allow users to specify custom locations using environment variables. This flexibility can be crucial for users with unique directory structures or for testing. A good practice is to notify the user about the location of the configuration and data directories. An example from the template is to print out these locations when the user invokes the --version command-line argument. See the section on Command line argument parsing Hereâ€™s an example get_data_dir() and get_config_dir() functions for your reference: use std::path::PathBuf; use anyhow::{anyhow, Context, Result};
use directories::ProjectDirs; pub fn get_data_dir() -> Result<PathBuf> { let directory = if let Ok(s) = std::env::var("RATATUI_TEMPLATE_DATA") { PathBuf::from(s) } else if let Some(proj_dirs) = ProjectDirs::from("com", "kdheepak", "ratatui-template") { proj_dirs.data_local_dir().to_path_buf() } else { return Err(anyhow!("Unable to find data directory for ratatui-template")); }; Ok(directory)
