} You will want to replace kdheepak with your user name or company name (or any unique name for that matter); and ratatui-app with the name of your CLI. I own https://kdheepak.com so I tend to use com.kdheepak.ratatui-app for my project directories. That way it is unlikely that any other program will mess with the configuration files for the app I plan on distributing.

