_info { // If the `git_info` contains `CARGO_PKG_VERSION`, we simply use `git_info` as it is. // Otherwise, prepend `CARGO_PKG_VERSION` to `git_info`. if git_info.contains(cargo_pkg_version) { // Remove the 'g' before the commit sha let git_info = &git_info.replace('g', ""); git_describe = git_info.to_string(); } else { git_describe = format!("v{}-{}", cargo_pkg_version, git_info); } } println!("cargo:rustc-env=RATATUI_TEMPLATE_GIT_INFO={}", git_describe);
}

