We can extract significant parts of the main() function into separate smaller functions, e.g. startup(), shutdown(), ui(), update(), run(). startup() is responsible for initializing the terminal. fn startup() -> Result<()> { enable_raw_mode()?; execute!(std::io::stderr(), EnterAlternateScreen)?; Ok(())
} shutdown() cleans up the terminal. fn shutdown() -> Result<()> { execute!(std::io::stderr(), LeaveAlternateScreen)?; disable_raw_mode()?; Ok(())
} ui() handles rendering of our application state. fn ui(f: &mut Frame<'_>, app: &App) { f.render_widget(Paragraph::new(format!("Counter: {}", app.counter)), f.size());
} update() processes user input and updates our application state. fn update(app: &mut App) -> Result<()> { if event::poll(std::time::Duration::from_millis(250))? { if let Key(key) = event::read()? { match key.code { Char('j') => app.counter += 1, Char('k') => app.counter -= 1, Char('q') => app.should_quit = true, _ => (), } } } Ok(())
} Youâ€™ll notice that in the update() function we make use of pattern matching for handling user input. This is a powerful feature in rust; and enhances readability and provides a clear pattern for how each input is processed. run() contains our main application loop. fn run() -> Result<()> { // ratatui terminal let mut t = Terminal::new(CrosstermBackend::new(std::io::stderr()))?; // application state let mut app = App { counter: 0, should_quit: false }; loop { // application render t.draw(|f| { ui(f, &app); })?; // application update update(&mut app)?; // application exit if app.should_quit { break; } } Ok(())
} Each function now has a specific task, making our main application logic more organized and easier to follow. fn main() -> Result<()> { startup()?; let status = run(); shutdown()?; status?; Ok(())
} Note You may be wondering if we could have written the main function like so: fn main() -> Result<()> { startup()?; run()?; shutdown()?; Ok(())
} This works fine during the happy path of a program. However, if your run() function returns an error, the program will not call shutdown(). And this can leave your terminal in a messed up state for your users. Instead, we should ensure that shutdown() is always called before the program exits. fn main() -> Result<()> { startup()?; let result = run(); shutdown()?; result?; Ok(())
} Here, we can get the result of run(), and call shutdown() first and then unwrap() on the result. This will be a much better experience for users. We will discuss in future sections how to handle the situation when your code unexpectedly panics.

