By making our code more organized, modular, and readable, we not only make it easier for others to understand and work with but also set the stage for future enhancements and extensions. Hereâ€™s the full code for reference: use anyhow::Result;
use crossterm::{ event::{self, Event::Key, KeyCode::Char}, execute, terminal::{disable_raw_mode, enable_raw_mode, EnterAlternateScreen, LeaveAlternateScreen},
};
use ratatui::{ prelude::{CrosstermBackend, Terminal}, widgets::Paragraph,
}; pub type Frame<'a> = ratatui::Frame<'a, CrosstermBackend<std::io::Stderr>>; fn startup() -> Result<()> { enable_raw_mode()?; execute!(std::io::stderr(), EnterAlternateScreen)?; Ok(())
} fn shutdown() -> Result<()> { execute!(std::io::stderr(), LeaveAlternateScreen)?; disable_raw_mode()?; Ok(())
} // App state
struct App { counter: i64, should_quit: bool,
} // App ui render function
fn ui(f: &mut Frame<'_>, app: &App) { f.render_widget(Paragraph::new(format!("Counter: {}", app.counter)), f.size());
} // App update function
fn update(app: &mut App) -> Result<()> { if event::poll(std::time::Duration::from_millis(250))? { if let Key(key) = event::read()? { match key.code { Char('j') => app.counter += 1, Char('k') => app.counter -= 1, Char('q') => app.should_quit = true, _ => (), } } } Ok(())
} fn run() -> Result<()> { // ratatui terminal let mut t = Terminal::new(CrosstermBackend::new(std::io::stderr()))?; // application state let mut app = App { counter: 0, should_quit: false }; loop { // application update update(&mut app)?; // application render t.draw(|f| { ui(f, &app); })?; // application exit if app.should_quit { break; } } Ok(())
} fn main() -> Result<()> { // setup terminal startup()?; let result = run(); // teardown terminal before unwrapping Result of app run shutdown()?; result?; Ok(())
