We are going to introduce a new concept right now. The concept of an EventHandler. Previously, we were polling for key inputs every 250 ms using crossterm as part of the main loop. Instead, now we are going to start a thread in the background that does the same thing. First, letâ€™s create an Event enum to handle the different kinds of events that can occur: /// Terminal events.
#[derive(Clone, Copy, Debug)]
pub enum Event { /// Terminal tick. Tick, /// Key press. Key(KeyEvent), /// Mouse click/scroll. Mouse(MouseEvent), /// Terminal resize. Resize(u16, u16),
} Next, letâ€™s create an EventHandler struct: use std::{sync::mpsc, thread}; /// Terminal event handler.
#[derive(Debug)]
pub struct EventHandler { /// Event sender channel. sender: mpsc::Sender<Event>, /// Event receiver channel. receiver: mpsc::Receiver<Event>, /// Event handler thread. handler: thread::JoinHandle<()>,
} We are using std::sync::mpsc which is a â€œMultiple Producer Single Consumerâ€ channel. Tip A channel is a thread-safe communication mechanism that allows data to be transmitted between threads. Essentially, itâ€™s a conduit where one or more threads (the producers) can send data, and another thread (the consumer) can receive this data. In Rust, channels are particularly useful for sending data between threads without the need for locks or other synchronization mechanisms. The â€œMultiple Producer, Single Consumerâ€ aspect of std::sync::mpsc means that while multiple threads can send data into the channel, only a single thread can retrieve and process this data, ensuring a clear and orderly flow of information. Note In the code in this section, we only need a â€œSingle Producer, Single Consumerâ€ but we are going to use mpsc to set us up for the future. Finally, hereâ€™s the code that starts a thread that polls for events from crossterm and maps it to our Event enum. impl EventHandler { /// Constructs a new instance of [`EventHandler`]. pub fn new(tick_rate: u64) -> Self { let tick_rate = Duration::from_millis(tick_rate); let (sender, receiver) = mpsc::channel(); let handler = { let sender = sender.clone(); thread::spawn(move || { let mut last_tick = Instant::now(); loop { let timeout = tick_rate.checked_sub(last_tick.elapsed()).unwrap_or(tick_rate); if event::poll(timeout).expect("no events available") { match event::read().expect("unable to read event") { CrosstermEvent::Key(e) => sender.send(Event::Key(e)), CrosstermEvent::Mouse(e) => sender.send(Event::Mouse(e)), CrosstermEvent::Resize(w, h) => sender.send(Event::Resize(w, h)), _ => unimplemented!(), } .expect("failed to send terminal event") } if last_tick.elapsed() >= tick_rate { sender.send(Event::Tick).expect("failed to send tick event"); last_tick = Instant::now(); } } }) }; Self { sender, receiver, handler } } /// Receive the next event from the handler thread. /// /// This function will always block the current thread if /// there is no data available and it's possible for more data to be sent. pub fn next(&self) -> Result<Event> { Ok(self.receiver.recv()?) }
} At the beginning of our EventHandler new method, we create a channel using mpsc::channel(). let (sender, receiver) = mpsc::channel(); This gives us a sender and receiver pair. The sender can be used to send events, while the receiver can be used to receive them. A new thread is spawned to handle events. This thread runs in the background and is responsible for polling and sending events to our main application through the channel. Within our background thread, we continuously poll for events with event::poll(timeout). If an event is available, itâ€™s read and sent through the sender channel. The types of events we handle include keypresses, mouse movements, screen resizing, and regular time ticks. if event::poll(timeout)? { match event::read()? { CrosstermEvent::Key(e) => sender.send(Event::Key(e))?, CrosstermEvent::Mouse(e) => sender.send(Event::Mouse(e))?, CrosstermEvent::Resize(w, h) => sender.send(Event::Resize(w, h))?, _ => unimplemented!(), }
} We expose the receiver channel as part of a next() method. pub fn next(&self) -> Result<Event> { Ok(self.receiver.recv()?) } Calling event_handler.next() method will call receiver.recv() which will cause the thread to block until the receiver gets a new event. Finally, we update the last_tick value based on the time elapsed since the previous Tick. We also send a Event::Tick on the channel during this. if last_tick.elapsed() >= tick_rate { sender.send(Event::Tick).expect("failed to send tick event"); last_tick = Instant::now();
} In summary, our EventHandler abstracts away the complexity of event polling and handling into a dedicated background thread.

