use tokio::{ sync::{mpsc, oneshot}, task::JoinHandle,
}; #[derive(Clone, Copy, Debug)]
pub enum Event { Error, AppTick, Key(KeyEvent),
} #[derive(Debug)]
pub struct EventHandler { _tx: mpsc::UnboundedSender<Event>, rx: mpsc::UnboundedReceiver<Event>, task: Option<JoinHandle<()>>, stop_cancellation_token: CancellationToken,
} impl EventHandler { pub fn new(tick_rate: u64) -> Self { let tick_rate = std::time::Duration::from_millis(tick_rate); let (tx, rx) = mpsc::unbounded_channel(); let _tx = tx.clone(); let stop_cancellation_token = CancellationToken::new(); let _stop_cancellation_token = stop_cancellation_token.clone(); let task = tokio::spawn(async move { let mut reader = crossterm::event::EventStream::new(); let mut interval = tokio::time::interval(tick_rate); loop { let delay = interval.tick(); let crossterm_event = reader.next().fuse(); tokio::select! { _ = _stop_cancellation_token.cancelled() => { break; } maybe_event = crossterm_event => { match maybe_event { Some(Ok(evt)) => { match evt { CrosstermEvent::Key(key) => { if key.kind == KeyEventKind::Press { tx.send(Event::Key(key)).unwrap(); } }, _ => {}, } } Some(Err(_)) => { tx.send(Event::Error).unwrap(); } None => {}, } }, _ = delay => { tx.send(Event::AppTick).unwrap(); }, } } }); Self { _tx, rx, task: Some(task), stop_cancellation_token } } pub async fn next(&mut self) -> Option<Event> { self.rx.recv().await } pub async fn stop(&mut self) -> Result<()> { self.stop_cancellation_token.cancel(); if let Some(handle) = self.task.take() { handle.await.unwrap(); } Ok(()) }
} Note Using crossterm::event::EventStream::new() requires the event-stream feature to be enabled. crossterm = { version = "0.27.0", features = ["event-stream"] } With this EventHandler implemented, we can use tokio to create a separate â€œtaskâ€ that handles any key asynchronously in our main loop. In the next section, we will introduce a Command pattern to bridge handling the effect of an event.

