Updates in TEA are actions triggered by events, such as user inputs. The core idea is to map each of these actions or events to a message. This can be achieved by creating an enum to keep track of messages. Based on the received message, the current state of the model is used to determine the next state. Defining a Message enum enum Message { //... various inputs or actions that your app cares about // e.g., ButtonPressed, TextEntered, etc.
} For a counter app, our Message enum may look like this: enum Message { Increment, Decrement, Reset, Quit,
} update() function The update function is at the heart of this process. It takes the current model and a message, and decides how the model should change in response to that message. A key feature of TEA is immutability. Hence, the update function should avoid direct mutation of the model. Instead, it should produce a new instance of the model reflecting the desired changes. fn update(model: &Model, msg: Message) -> Model { match msg { // Match each possible message and decide how the model should change // Return a new model reflecting those changes }
} In TEA, itâ€™s crucial to maintain a clear separation between the data (model) and the logic that alters it (update). This immutability principle ensures predictability and makes the application easier to reason about. Note Hence, while immutability is emphasized in TEA, Rust developers can choose the most suitable approach based on performance and their applicationâ€™s needs. For example, it would be perfectly valid to do the following: fn update(model: &mut Model, msg: Message) { match msg { // Match each possible message and decide how the model should change // Modify existing mode reflecting those changes };
} In TEA, the update() function can not only modify the model based on the Message, but it can also return another Message. This design can be particularly useful if you want to chain messages or have an update lead to another update. For example, this is what the update() function may look like for a counter app: fn update(model: &mut Model, msg: Message) -> Option<Message> { match msg { Message::Increment => { model.counter += 1; if model.counter > 50 { return Some(Message::Reset); } }, Message::Decrement => { model.counter -= 1; if model.counter < -50 { return Some(Message::Reset); } }, Message::Reset => { model.counter = 0; }, Message::Quit => { model.should_quit = true; }, _ => {}, } None // Default return value if no specific message is to be returned
} Attention Remember that this design choice means that the main loop will need to handle the returned message, calling update() again based on that returned message. Returning a Message from the update() function allows a developer to reason about their code as a â€œFinite State Machineâ€. Finite State Machines operate on defined states and transitions, where an initial state and an event (in our case, a Message) lead to a subsequent state. This cascading approach ensures that the system remains in a consistent and predictable state after handling a series of interconnected events. Hereâ€™s a state transition diagram of the counter example from above: stateDiagram-v2 state Model { counter : counter = 0 should_quit : should_quit = false } Model --&gt; Increment Model --&gt; Decrement Model --&gt; Reset Model --&gt; Quit Increment --&gt; Model: counter += 1 Increment --&gt; Reset: if &gt; 50 Decrement --&gt; Model: counter -= 1 Decrement --&gt; Reset: if &lt; -50 Reset --&gt; Model: counter = 0 Quit --&gt; break: should_quit = true While TEA doesnâ€™t use the Finite State Machine terminology or strictly enforce that paradigm, thinking of your applicationâ€™s state as a state machine can allow developers to break down intricate state transitions into smaller, more manageable steps. This can make designing the applicationâ€™s logic clearer and improve code maintainability.

